INSERT INTO `item` VALUES ('I-1303996485674','Monthly Pass','','','<p>\r\n	Within <span style=\"color: rgb(255, 0, 0); \"><strong><span style=\"background-color: rgb(255, 255, 0); \">FOUR</span></strong></span> <strong>DIM SUM / WOK</strong> lessons in one month!</p>\r\n<div>\r\n	All <strong>KITCHENS</strong> acceptable!</div>\r\n','<p>\r\n	&nbsp;</p>\r\n<div>\r\n	<span class=\"il\" style=\"background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: rgb(255, 255, 204); color: rgb(34, 34, 34); background-position: initial initial; background-repeat: initial initial; \"></span><span style=\"color: rgb(255, 0, 0); \"><strong><span style=\"background-color: rgb(255, 255, 0); \">4</span></strong></span></div>\r\n<div>\r\n	 / </div>\r\n<div>\r\n	</div>\r\n','<div>\r\n	1<span class=\"il\" style=\"background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: rgb(255, 255, 204); color: rgb(34, 34, 34); background-position: initial initial; background-repeat: initial initial; \"></span><span style=\"color: rgb(255, 0, 0); \"><strong><span style=\"background-color: rgb(255, 255, 0); \">4</span></strong></span></div>\r\n<div>\r\n	/</div>\r\n<div>\r\n	</div>\r\n','dim sum, wok, MONTHLY PASS','dim sum, wok, MONTHLY PASS',1,'/uploaded/market/1303996448547.jpg','/uploaded/market/1303996448547.jpg','','',NULL,'yes',500,'2011-05-01','2011-12-31',211),('I-1305295732140','Chinese Dim Sum Primary and Intermediate Courses','','','<div>\r\n	Chinese Dim Sum Primary and Intermediate Courses: Three-day course for all together 40 dim sums. 1800 RMB/person (starts with a minimum of two)</div>\r\n<ol>\r\n	<li>\r\n		Leavened dough: steamed bun (meat filling + veggie filling) + twisted steamed roll+ sesame cake</li>\r\n	<li>\r\n		Steamed dumpling: Hat shaped dumpling+ four happiness dumpling+ half moon shaped dumpling+ love bird shaped dumpling+ gold fish shaped dumpling+ insect shaped dumpling</li>\r\n	<li>\r\n		Fried bun+ fried dumpling+ sesame ball+ sweet dumpling+ steamed radish cake</li>\r\n	<li>\r\n		Xiaolongbao + Xuemeiniang (glutinous rice cake with cream and fruit filling) + noodles mixed with scallion, oil and soy sauce+ spring pancake+ plum blossom shaped bun</li>\r\n	<li>\r\n		Siu Mai+ steamed radish cake+ spring roll+ dumpling+ rice wine small dumpling soup</li>\r\n	<li>\r\n		Big wonton+ small wonton (boiled +deep fried) + sweet dumpling coated with coconut slices+ dragon boat festival food + pear shaped dumpling</li>\r\n	<li>\r\n		Shrimp dumpling+ sticky rice wrapped by the lotus leaf+ red bean paste sweet soup+ mango pudding + almond jelly sauce +coconut sago sweet soup</li>\r\n	<li>\r\n		Pumpkin cake+ green union flavor pancake+ eight treasure rice+ salted sticky rice flour dumpling+ fried smiling dough coated with sesame seeds</li>\r\n</ol>\r\n','','<div>\r\n	<p>\r\n		</p>\r\n	<ol>\r\n		<li>\r\n			+++</li>\r\n		<li>\r\n			+++()++</li>\r\n		<li>\r\n			++++</li>\r\n		<li>\r\n			++++</li>\r\n		<li>\r\n			++++</li>\r\n		<li>\r\n			+++++</li>\r\n		<li>\r\n			+++++</li>\r\n		<li>\r\n			++++</li>\r\n	</ol>\r\n	<p>\r\n		4031800/2</p>\r\n</div>\r\n','Chinese Dim Sum Primary and Intermediate Courses,','Chinese Dim Sum Primary and Intermediate Courses,',1,'/uploaded/market/1305294844202.jpg','/uploaded/market/1305294844202.jpg','','',NULL,'yes',3600,'2011-05-14','2011-12-31',18);
