INSERT INTO `news` VALUES (2,'Welcome to visit our new home. ','<p>\r\n	CCW Website 2.0 is coming! Welcome to visit our new HOME!</p>\r\n<p>\r\n	Chinese Cooking Workshop (<a href=\"http://www.chinesecookingworkshop.com\">www.chinesecookingworkshop.com</a>) was established in the year of 2003 and it&#39;s the first full time and hands-on expats targeted cooking program in Shanghai. We open 7 days per week, all year round in Shanghai; only take holiday break during Chinese New Year festival.</p>\r\n<p>\r\n	In the year of 2005, we open our Pudong kitchen after Puxi in Shanghai, in the year of 2008, we open our Suzhou private cooking program with the strong support of the local expats communities.</p>\r\n<p>\r\n	Chinese Cooking Workshop is a unique lifestyle and culture network to be more just cooking. The network is committed to develop the authentic cooking fun and enjoyable travel experience for both expats living in the cities we have program running and the travelers to China.</p>\r\n<p>\r\n	Through hands-on cooking program, wet market tour, gourmet tour, Farmer&#39;s Market, mini food fair and food publications, Chinese Cooking Workshop expands its business into a lifestyle hub to attract alike minds all over the world.&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	CCW','CCW','2011-05-01','','yes','Chinese Cooking Workshop, Wok, Dim Sum, Local Food','This cooking school hosts workshops spanning Sichuan, Cantonese, Shanghainese, Thai, Indonesian and Indian cuisine styles.'),(3,'City Weekend Says','<p>\r\n	This cooking school hosts workshops spanning Sichuan, Cantonese, Shanghainese, Thai, Indonesian and Indian cuisine styles. There are also seasonal classes, such as hairy crab lessons in the autumn, pastry classes and wet market tours, where newbies learn about navigating Shanghai&#39;s local markets. Workshops are held during afternoons and evenings and custom-made classes are also available for those eager to tailor-make their cooking experiences.</p>\r\n','CCW','2010-06-01',NULL,'yes','seasonal classes, wok, dim sum, cooking','This cooking school hosts workshops spanning Sichuan, Cantonese, Shanghainese, Thai, Indonesian and Indian cuisine styles.'),(4,'10 of us girls decided to organise a cooking night','<p>\r\n	10 of us girls decided to organise a&nbsp;<b>cooking night</b>, held by the&nbsp;<b><a href=\"http://www.chinesecookingworkshop.com/\" id=\"link_1\" style=\"color: rgb(0, 0, 204); background-color: transparent; \">Chinese Cooking Workshop</a></b>. It&#39;s a large industrial kitchen with bilingual chefs and assistants - basically catered for expats to get together and learn how to cook Chinese food. IT&#39;S HELLA FUN!<br />\r\n	<br />\r\n	Chef Huang was our star of the evening - a very very sweet guy that joked along with the rest of us. He handled 10 women wanting to marry him for his culinary skills very well ;) Man, the guy can cook! He makes it all look so easy, though we were struggling and looking so uncoordinated. It made me realise that Chinese cooking isn&#39;t so hard, but it&#39;s all in the preparation - which takes ages chop chop chopping stuff. Other than that, it&#39;s all actually quite straightforward.<br />\r\n	<br />\r\n	We whipped up&nbsp;<b>10 courses&nbsp;</b>(!!!!!!!!!!!) and got to sample our hard work. The food was all, surprisingly, delicious! Impressive considering we were first-timers, but I chalk it up to Chef Huang&#39;s great instructions and patience.. especially since we were all drinking wine and laughing whilst trying to cook ;)<br />\r\n	<br />\r\n	It was a fabulous evening with girl friends, and a great way to get together and have fun, whilst being productive. The only thing I would suggest to them would be to also serve free-flow cocktails through the night (at an extra flat-rate price), which will make it a lot more fun. And perhaps to have a CD player with some great music. But all in all, it was brilliant fun. Plus, it was only&nbsp;<b>US$20 per person</b>!!!! To learn and eat 10 courses!!!! CRAZINESS. I love China.<br />\r\n	<br />\r\n	Couldn&#39;t recommend it more!</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking01.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking02.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking26.jpg\" style=\"width: 300px; height: 400px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking04.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking05.jpg\" style=\"width: 350px; height: 478px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking06.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking07.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking08.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking09.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking10.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking11.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking12.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking28.jpg\" style=\"width: 448px; height: 336px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking18.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking23.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking24.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking25.jpg\" style=\"width: 500px; height: 334px; \" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://beverlys.net/photos/2009/ChineseCookingClass/Cooking29.jpg\" style=\"width: 448px; height: 336px; \" /></p>\r\n','BEVERLY :)','2011-04-21','','yes','Chinese Cooking Workshop, Wok, Dim Sum, Local Food','It\'s a large industrial kitchen with bilingual chefs and assistants'),(5,'READ ME, more DISCOUNT. ','<div style=\"line-height: 22px; \">\r\n	<a href=\"http://www.chinesecookingworkshop.com/\" style=\"color: rgb(16, 57, 1); line-height: 22px; text-decoration: none; \" target=\"_blank\"><span style=\"color: rgb(0, 255, 0); \"><b style=\"line-height: 22px; \">CCW</b></span></a>&nbsp;members who were registered in CCW Website 1.0 are still avaliable in CCW Website 2.0. The registered members can get discount points and you pay less in the next booking. We will send news and coupon to you by email,&nbsp;<a href=\"http://www.chinesecookingworkshop.com/user/sign-up.htm\" style=\"color: rgb(16, 57, 1); line-height: 22px; text-decoration: none; \" target=\"_blank\"><span style=\"color: rgb(255, 0, 0); \"><b style=\"line-height: 22px; \">REGISTER NOW</b></span></a>. 30 seconds for register and 10 seconds for booking lessons. If you are a registered member, you also can book lessons by email, sooooooo&nbsp;convenient.</div>\r\n<div style=\"line-height: 22px; \">\r\n	&nbsp;</div>\r\n<p>\r\n	<span style=\"color: rgb(0, 255, 0); \">CCW</span>','CCW','2011-05-04','highlight','yes','READ ME, more DISCOUNT. ','READ ME, more DISCOUNT. '),(6,'Private Cooking Classes in Hong Kong, Shanghai, Beijing and Kobe, Japan','<p style=\"text-align: center; \">\r\n	<img alt=\"\" src=\"/uploaded/default/1312359302500.jpg\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<div style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Simsun; font-size: medium; \">\r\n	<span id=\"internal-source-marker_0.9609576014336199\" style=\"font-size: 11pt; font-family: Arial; color: rgb(109, 109, 109); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">February 26, 2008, 12:46 PM</span><br />\r\n	<a href=\"http://intransit.blogs.nytimes.com/2008/02/26/private-cooking-classes-in-hong-kong-shanghai-beijing-and-kobe-japan/\"><span style=\"font-size: 17pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">Private Cooking Classes in Hong Kong, Shanghai, Beijing and Kobe, Japan</span></a><br />\r\n	<span style=\"font-size: 11pt; font-family: Arial; color: rgb(109, 109, 109); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">By </span><a href=\"http://intransit.blogs.nytimes.com/author/david-g-allan/\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">DAVID G. ALLAN</span></a><br />\r\n	<br />\r\n	<span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">I am going on a cruise to Asia in March and I want to learn how to make local specialties in Hong Kong, Kobe, Shanghai and Beijing. Do you have any information on how to book private cooking classes in these cities?</span><br />\r\n	<span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">Amy Zhang,?Washington, DC.</span><br />\r\n	<br />\r\n	<span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">I put your question to </span><a href=\"http://travel.nytimes.com/gst/travel/travsearch.html?term=byline%3ABY%20TAYLOR%20HOLLIDAY\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">Taylor Holliday</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \"> who wrote &ldquo;</span><a href=\"http://travel.nytimes.com/2007/04/15/travel/15cooking.html\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">Have Spatula Will Travel</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">&rdquo; (April 15, 2007) about international cooking school vacations. Although her story did not cover the four cities in your query, she did have recommendations for two of them.</span><br />\r\n	<br />\r\n	<span style=\"font-size: 11pt; font-family: Arial; color: rgb(83, 83, 83); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">Student chefs at the New Orient Cuisine College, Beijing&rsquo;s largest cookery school. (EPA/Adrian Bradshaw)</span><br />\r\n	<span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">In </span><a href=\"http://travel.nytimes.com/travel/guides/asia/china/beijing/overview.html\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">Beijing</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">, her friend Adlyn Adam-Teoh runs a program called Hias Gourmet: Culinary Excursions in Beijing (</span><a href=\"http://hiasgourmet.com/cookingclass.htm\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">http://hiasgourmet.com/cookingclass.htm</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">) with cooking classes in a traditional hutong (alley) home kitchen. Ms. Holliday recently took the class and described it as basic &ldquo;but fun and unique.&rdquo; In </span><a href=\"http://travel.nytimes.com/travel/guides/asia/china/hong-kong/overview.html\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">Hong Kong</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">, she knows of Martha Sherpa&rsquo;s Cooking School (</span><a href=\"http://www.geocities.com/professional_cookery\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">www.geocities.com/professional_cookery</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">) which she thinks looks promising, but hasn&rsquo;t take a class there herself. Both schools have English instruction and offer a choice of private or group classes for traditional Chinese cuisine.</span><br />\r\n	<span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">For </span><a href=\"http://travel.nytimes.com/travel/guides/asia/china/shanghai/overview.html\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">Shanghai</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">, some Web scouring uncovered a few options, including the Chinese Cooking Workshop (</span><a href=\"http://www.chinesecookingworkshop.com/\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">www.chinesecookingworkshop.com</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">) which offers both dim sum and wok courses throughout March and The Kitchen at&hellip;Huaihailu (</span><a href=\"http://www.thekitchenat.com/\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">www.thekitchenat.com</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">) which does not limit its menu to regional dishes. You can also find many postings about private cooking instruction in Shanghai and Beijing by searching for &ldquo;cooking class&rdquo; on the City Weekend Website (</span><a href=\"http://www.cityweekend.com.cn/\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">www.cityweekend.com.cn</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">).</span><br />\r\n	<span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">In </span><a href=\"http://travel.nytimes.com/travel/guides/asia/japan/kobe/overview.html\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">Kobe</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">, </span><a href=\"http://travel.nytimes.com/travel/guides/asia/japan/overview.html\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">Japan</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">, the only cooking classes I could find in the Spring are organized by the Community House &amp; Information Centre (81-78-857-6540; </span><a href=\"http://www.chickobe.com/\"><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(10, 47, 103); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap; \">www.chickobe.com</span></a><span style=\"font-size: 14pt; font-family: Georgia; color: rgb(38, 38, 38); background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap; \">), a non-profit community service organization serving the international community in the city. They offer a non-private class on Yakitori and Teriiyaki, offered on March 6 and open to non-members. &ndash; DAVID G. ALLAN</span></div>\r\n','DAVID G. ALLAN','2011-08-03','highlight','yes','Private Cooking Classes in Hong Kong, Shanghai, Beijing and Kobe, Japan','Private Cooking Classes in Hong Kong, Shanghai, Beijing and Kobe, Japan');
